webpackJsonp([27944151523156],{8937:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Let's Make a Deal!",date:"14 Dec 2002",slug:"/2002-12-14-lets-make-a-deal/",tags:"Y2002"},html:'<p>Maybe we can trade Hesse\'s Premier <a href="http://www.faz.com/IN/INtemplates/eFAZ/docmain.asp?rub=%7BB1311FCC-FBFB-11D2-B228-00105A9CAF88%7D&doc=%7B07CDDD54-2636-4CC3-A389-186ADAEE3E52%7D" title="FAZ: Uproar over Nazi-era analogy">Roland Koch</a> for US Senate Majority Leader <a href="http://www.washingtonpost.com/wp-dyn/articles/A53057-2002Dec13.html" title="Washington Post: Sen. Lott Fights to Save Post As Leader">Trent Lott</a>. We\'ll even throw in <a href="http://www.daeubler-gmelin.de/" title="Personal Website of ex-Justice-Minister Däubler-Gmelin">Herta Däubler-Gmelin</a> and a future draft choice.</p>'},next:{fields:{title:"Christmas Card",date:"12 Dec 2002",slug:"/2002-12-12-christmas-card/"}},previous:{fields:{title:"Tree Killer",date:"14 Dec 2002",slug:"/2002-12-14-tree-killer/"}}},{node:{fields:{title:"Christmas Card",date:"12 Dec 2002",slug:"/2002-12-12-christmas-card/",tags:"Y2002"},html:'<p><img src="http://www.papascott.de/images/crhmuffin1102.jpg" border="0" alt="Holiday Baking" title="Holiday Baking" /></p>\n<p>Christopher is helping with the holiday baking this year. Hopefully he\'ll help with the clean-up as well! </p>\n<p><em>Merry Christmas from Scott, Mama and Christopher</em></p>\n<p>(Thanks to <a href="http://radio.weblogs.com/0001011/2002/12/11.html#a1841">Scoble for pointing</a> to the <a href="http://www.usps.com/holiday/greeting.htm">card shop at USPS</a>. That\'s how we\'re sending <a href="http://www.papascott.de/images/xmas2002.pdf" title="Inside of card as pdf">this card</a> to my US relatives.)</p>'},next:{fields:{title:"Packages",date:"10 Dec 2002",slug:"/2002-12-10-packages/"}},previous:{fields:{title:"Let's Make a Deal!",date:"14 Dec 2002",slug:"/2002-12-14-lets-make-a-deal/"}}},{node:{fields:{title:"Packages",date:"10 Dec 2002",slug:"/2002-12-10-packages/",tags:"Y2002"},html:"<p>Chrisopher's Grandparents will be happy to know that both of his Christmas packages, sent from Minnesota on 2 Dec,  arrived yesterday, even though one was sent air-mail and the other not. Interestingly, even though they were sent via USPS, they were not delivered by the German Post, but by DHL.</p>"},next:{fields:{title:"Grinding Away",date:"10 Dec 2002",slug:"/2002-12-10-grinding-away/"}},previous:{fields:{title:"Christmas Card",date:"12 Dec 2002",slug:"/2002-12-12-christmas-card/"}}}],pathPrefix:"",first:!1,last:!1,index:807,pageCount:1101}}}});
